import React, {Component} from 'react';
import "./css/nav.css";

class Navbar extends Component {
    
    render(){
        return(
            <div>
                <section class="section intro">
                <div class="container">
                <h1>Blind</h1>
                </div>
                </section>
            </div>
        );
    }
}


export default Navbar;
